import {LinkTokenInterface} from "@chainlink/contracts/src/v0.8/interfaces/LinkTokenInterface.sol";
import {IRouterClient} from "@chainlink/contracts-ccip/src/v0.8/ccip/interfaces/IRouterClient.sol";

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {SafeERC20} from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

contract CrossChainController is CCIPReceiver, Ownable {
    using SafeERC20 for IERC20;

    enum PayFeesIn {
        Native,
        LINK
    }

    address private receiver; // Vault on the destination chain
    address private router = 0x0BF3dE8c5D3e8A2B34D2BEeB17ABfCeBaf363A59;
    address private link = 0x779877A7B0D9E8603169DdbD7836e478b4624789;

    uint64 immutable destinationChainSelector = 13264668187771770619;

    // Track user balances for cross-chain tokens
    mapping(address => mapping(address => uint256)) public balances; // user => token => amount
    mapping(address => address[]) public userTokens; // User's array of tokens that can be transferred cross-chain

    event DepositRegistered(address indexed user, address indexed token, uint256 amount);
    event TokenWithdrawn(address indexed user, address indexed token, uint256 amount);
    event CrossChainTransferInitiated(bytes32 messageId);

    error FailedToWithdrawEth(address owner, address target, uint256 value);

    constructor(address _initialOwner) Ownable(_initialOwner) CCIPReceiver(router) {
    }

    // Function to handle cross-chain messages received from the source chain
    function _ccipReceive(Client.Any2EVMMessage memory message) internal override {
        (address user, address token, uint256 amount) = abi.decode(message.data, (address, address, uint256));

        // Register the deposit by updating the user's balance
        balances[user][token] += amount;

        userTokens[msg.sender].push(token);

        emit DepositRegistered(user, token, amount);
    }

    // Function to initiate a cross-chain transfer of tokens from the destination chain back to the source chain
    function transferToSourceChain(
        address token,
        uint256 amount,
        address user,
        PayFeesIn payFeesIn
    ) external {
        require(balances[msg.sender][token] >= amount, "Insufficient balance");

        // Update balance
        balances[msg.sender][token] -= amount;

        // Prepare cross-chain message
        Client.EVM2AnyMessage memory message = Client.EVM2AnyMessage({
            receiver: abi.encode(receiver),
            data: abi.encodeWithSignature("sendFunds(address,address,uint256)", user, token, amount),
            tokenAmounts: new Client.EVMTokenAmount[](0),
            extraArgs: "",
            feeToken: payFeesIn == PayFeesIn.LINK ? link : address(0)
        });

        uint256 fee = IRouterClient(router).getFee(destinationChainSelector, message);

        bytes32 messageId;

        if (payFeesIn == PayFeesIn.LINK) {
            LinkTokenInterface(link).approve(router, fee);
            messageId = IRouterClient(router).ccipSend(destinationChainSelector, message);
        } else {
            messageId = IRouterClient(router).ccipSend{value: fee}(destinationChainSelector, message);
        }

        emit CrossChainTransferInitiated(messageId);
    }

    function setReceiver(address newReceiver) external onlyOwner {
        receiver = newReceiver;
    }

    function setRouter(address newRouter) external onlyOwner {
        router = newRouter;
    }

    function setLink(address newLink) external onlyOwner {
        link = newLink;
    }

    function withdrawNative(address beneficiary) external onlyOwner {
        uint256 amount = address(this).balance;
        (bool sent, ) = beneficiary.call{value: amount}("");
        if (!sent) revert FailedToWithdrawEth(msg.sender, beneficiary, amount);
    }

    function withdrawToken(
        address beneficiary,
        address token
    ) external onlyOwner {
        uint256 amount = IERC20(token).balanceOf(address(this));
        IERC20(token).safeTransfer(beneficiary, amount);
    }

    function getTokensLength(address user) external view returns(uint256) {
        return userTokens[user].length;
    }
}

