// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {SafeERC20} from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

import {IRouterClient} from "@chainlink/contracts-ccip/src/v0.8/ccip/interfaces/IRouterClient.sol";
import {Client} from "@chainlink/contracts-ccip/src/v0.8/ccip/libraries/Client.sol";
import {LinkTokenInterface} from "@chainlink/contracts/src/v0.8/interfaces/LinkTokenInterface.sol";

contract Vault is Ownable {
    using SafeERC20 for IERC20;

    enum PayFeesIn {
        Native,
        LINK
    }

    uint64 immutable destinationChainSelector = 16015286601757825753;

    address private router = 0xE1053aE1857476f36A3C62580FF9b016E8EE8F6f;
    address private link = 0x84b9B910527Ad5C03A9Ca831909E21e236EA7b06;
    address private master; // Contract from the other network

    mapping(address => mapping(address => uint256)) public balances; // user => token => amount

    event Deposited(address indexed user, address indexed token, uint256 amount);
    event MessageSent(bytes32 messageId);

    error FailedToWithdrawEth(address owner, address target, uint256 value);

    constructor() Ownable(msg.sender){
    }

    receive() external payable {}

    // Only router modifier
    modifier onlyRouter() {
        require(
            msg.sender == router,
            "Not router!"
        );

        _;
    }

    function deposit(
        address token,
        uint256 amount,
        PayFeesIn payFeesIn
    ) external {
        require(amount > 0, "Amount must be greater than 0");

        // Transfer tokens from user to this contract
        IERC20(token).transferFrom(msg.sender, address(this), amount);

        // Update balance
        balances[msg.sender][token] += amount;

        // Prepare cross-chain message
        Client.EVM2AnyMessage memory message = Client.EVM2AnyMessage({
            receiver: abi.encode(master),
            data: abi.encodeWithSignature("registerDeposit(address,address,uint256)", msg.sender, token, amount),
            tokenAmounts: new Client.EVMTokenAmount[](0),
            extraArgs: "",
            feeToken: payFeesIn == PayFeesIn.LINK ? link : address(0)
        });

        uint256 fee = IRouterClient(router).getFee(destinationChainSelector, message);

        bytes32 messageId;

        if (payFeesIn == PayFeesIn.LINK) {
            LinkTokenInterface(link).approve(router, fee);
            messageId = IRouterClient(router).ccipSend(destinationChainSelector, message);
        } else {
            messageId = IRouterClient(router).ccipSend{value: fee}(destinationChainSelector, message);
        }

        emit Deposited(msg.sender, token, amount);
        emit MessageSent(messageId);
    }

    // Direct withdraw
    function withdraw(address token, uint256 amount) external {
        require(balances[msg.sender][token] >= amount, "Insufficient balance");

        // Update balance
        balances[msg.sender][token] -= amount;

        // Transfer tokens back to user
        IERC20(token).transfer(msg.sender, amount);
    }

    // Withdraw from ccip
    function sendFunds(address user, address token, uint256 amount) external onlyRouter {
        require(balances[user][token] >= amount, "Insufficient balance");

        // Update balance
        balances[user][token] -= amount;

        // Transfer tokens to the user
        IERC20(token).transfer(user, amount);
    }

    function setMaster(address newMaster) external onlyOwner {
        master = newMaster;
    }

    function setRouter(address newRouter) external onlyOwner {
        router = newRouter;
    }

    function setLink(address newLink) external onlyOwner {
        link = newLink;
    }

    function withdrawNative(address beneficiary) external onlyOwner {
        uint256 amount = address(this).balance;
        (bool sent, ) = beneficiary.call{value: amount}("");
        if (!sent) revert FailedToWithdrawEth(msg.sender, beneficiary, amount);
    }

    function withdrawToken(
        address beneficiary,
        address token
    ) external onlyOwner {
        uint256 amount = IERC20(token).balanceOf(address(this));
        IERC20(token).safeTransfer(beneficiary, amount);
    }
}

